class UpdateEpisodioComponent {
    constructor(router, toastr, activatedRoute, episodioService) {
        this.router = router;
        this.toastr = toastr;
        this.activatedRoute = activatedRoute;
        this.episodioService = episodioService;
        this.episodio = {
            id: 0,
            Name: '',
            Detail: ''
        };
    }
    ngOnInit() {
        const params = this.activatedRoute.snapshot.params;
        if (params.id) {
            this.episodioService.getEpisodio(params.id).subscribe(res => {
                console.log(res);
                this.episodio = res;
            }, err => {
                this.toastr.error('Datos no obtenidos');
            });
        }
    }
    updateEpisodio() {
        const params = this.activatedRoute.snapshot.params;
        console.log(this.episodio);
        // llamando a servicio de creacion que esta enlazada con el api
        this.episodioService.updateEpisodio(params.id, this.episodio).subscribe(res => {
            console.log(res);
            this.router.navigate([
                'admin',
                'episodio',
                'list'
            ]);
            this.toastr.success('Nuevo episodio creado');
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo crear un nuevo episodio');
        });
    }
}
