class UpdateTestimonioComponent {
    constructor(router, toastr, activatedRoute, testimonioService) {
        this.router = router;
        this.toastr = toastr;
        this.activatedRoute = activatedRoute;
        this.testimonioService = testimonioService;
        this.testimonio = {
            id: 0,
            Testimony: '',
            ClienteId: 0
        };
        this.clientestimonio = {
            id: 0,
            Testimony: '',
            ClienteId: 0,
            cliente: {
                id: 0,
                Name: '',
                LastName: '',
                Photo: ''
            }
        };
        this.ladata = this.clientestimonio;
    }
    ngOnInit() {
        const params = this.activatedRoute.snapshot.params;
        if (params.id) {
            this.testimonioService.getTestimonio(params.id).subscribe(res => {
                console.log(res);
                this.testimonio = res;
                this.ladata = res;
            }, err => {
                console.log(err);
            });
        }
    }
    // tslint:disable-next-line: typedef
    updateTestimonio() {
        const params = this.activatedRoute.snapshot.params;
        this.testimonioService.updateTestimonio(params.id, this.testimonio).subscribe(res => {
            console.log(res);
            this.router.navigate([
                'admin',
                'testimonio',
                'list'
            ]);
            this.toastr.success('actualizando los datos del testimonio');
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo actualizar');
        });
    }
}
